soundeffect sound2play;
	
typedef struct {
	unsigned char *wave;
	uint32_t length;
} sound_t;

sound_t sounds[2] = {
	{JumpS, JumpLen},
	{LaserS, LaserLen},
};

void Timer3A_Stop(void){
	TIMER3_CTL_R = 0x00000000;    // Disable TIMER3A
};

uint32_t pIndex = 0;
void playsample(){
	DAC_Out(sounds[sound2play].wave[pIndex]);
	pIndex++;
	if (pIndex >= sounds[sound2play].length){
		Timer3A_Stop();
		pIndex=0;
	}
}
extern void Timer3_Init(void(*task)(void), uint32_t period);

void playsound(soundeffect sound){
	sound2play = sound;
	Timer3_Init(&playsample, 2500);
}

